import React from "react";
import "CircleIcon.css";

const CircleIcon = () => {
  return (
    <svg
      aria-hidden="true"
      className="iconCircleIcon icon-radio-unchecked"
      viewBox="0 0 32 32"
    >
      <use xlinkHref="#icon-radio-unchecked"></use>
    </svg>
  );
};

export default CircleIcon;
